(30, 0, 'mobeen@nxb.com.pk', 'noc@nxvt.com,  mis@nxb.com.pk', 'Zain Khan Lohani  / Gaming during unapproved timings', '<p>Mobeen Zafar Puri,</p>\r\n<p>Please see the log below for the user <strong>Zain Khan Lohani </strong> (EmployeeID 01587). <span style="text-decoration: underline;"><strong>We suspect that the user is running Counter Strike since its using udp ports that only Counter Strike/HalfLife uses.</strong></span></p>\r\n<table style="border: 1px solid #000; width: auto; margin-top: 25px; margin-bottom: 25px;">\r\n<tbody>\r\n<tr>\r\n<td width="200px;">Employee ID</td>\r\n<td width="200px;">01587</td>\r\n</tr>\r\n<tr>\r\n<td>Employee Name</td>\r\n<td>Zain Khan Lohani </td>\r\n</tr>\r\n<tr>\r\n<td>Manager Name</td>\r\n<td>Mobeen Zafar Puri</td>\r\n</tr>\r\n<tr>\r\n<td>Employee Location</td>\r\n<td>Lahore Center II</td>\r\n</tr>\r\n<tr>\r\n<td>Sitting Hall</td>\r\n<td>Hall 9</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Counter Strike<br /><br /></p>\r\n<p>According to our monitoring tools, the <strong>resource was found to be playing games before 7pm</strong>. Please address the disciplinary issue with the resouce as soon as possible and intimate us of the outcomes of the meeting.</p>\r\n<p>Thank you for your cooperation.</p>\r\n<p>&nbsp;</p>\r\n<p>--</p>\r\n<p>Network Operations Control,<br /> Nextbridge Pvt. Ltd. <br /><br /> <strong>Note:</strong> This is an automated email sent from a NOC engineer.</p>', 0, '2013-09-18 18:42:53', 1, '2013-09-18 13:42:53', 1);
