INSERT INTO `email_templates` (`id`, `title`, `subject`, `body`, `created`, `created_by`, `modified`, `modified_by`) VALUES
(1, 'Excessive Internet usage', '{Employee_Name} / Excessive Internet usage', '<p>{Manager_Name},</p>\r\n<p>Please see the log below for the user <strong>{Employee_Name}</strong> (EmployeeID {Employee_Id}).</p>\r\n<table style="border: 1px solid #000; width: auto; margin-top: 25px; margin-bottom: 25px;">\r\n<tbody>\r\n<tr>\r\n<td width="200px;">Employee ID</td>\r\n<td width="200px;">{Employee_Id}</td>\r\n</tr>\r\n<tr>\r\n<td>Employee Name</td>\r\n<td>{Employee_Name}</td>\r\n</tr>\r\n<tr>\r\n<td>Manager Name</td>\r\n<td>{Manager_Name}</td>\r\n</tr>\r\n<tr>\r\n<td>Employee Location</td>\r\n<td>{Employee_Location}</td>\r\n</tr>\r\n<tr>\r\n<td>Sitting Hall</td>\r\n<td>{Employee_Sitting_Hall}</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><br /> [LOG TABLE TO BE PASTED MANUALLY] <br /><br /></p>\r\n<p>According to our monitoring tools, the user is consuming excessive bandwidth. Please address the disciplinary issue with the resouce as soon as possible and intimate us of the outcomes of the meeting. If you wish, MIS/NOC can check the system of {Employee_Name} to verify the cause of this.</p>\r\n<p>Thank you for your cooperation.</p>\r\n<p>&nbsp;</p>\r\n<p>--</p>\r\n<p>Network Operations Control,<br /> Nextbridge Pvt. Ltd. <br /><br /> <strong>Note:</strong> This is an automated email sent from a NOC resource.</p>', '2013-02-26 23:10:10', 0, '2013-08-22 14:42:56', 0),
(3, 'Media Streaming (audio / video)', '{Employee_Name} / Media Streaming', '<p>{Manager_Name},</p>\r\n<p>Please see the log below for the user <strong>{Employee_Name}</strong> (EmployeeID {Employee_Id}).</p>\r\n<table style="border: 1px solid #000; width: auto; margin-top: 25px; margin-bottom: 25px;">\r\n<tbody>\r\n<tr>\r\n<td width="200px;">Employee ID</td>\r\n<td width="200px;">{Employee_Id}</td>\r\n</tr>\r\n<tr>\r\n<td>Employee Name</td>\r\n<td>{Employee_Name}</td>\r\n</tr>\r\n<tr>\r\n<td>Manager Name</td>\r\n<td>{Manager_Name}</td>\r\n</tr>\r\n<tr>\r\n<td>Employee Location</td>\r\n<td>{Employee_Location}</td>\r\n</tr>\r\n<tr>\r\n<td>Sitting Hall</td>\r\n<td>{Employee_Sitting_Hall}</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><br /> [LOG TABLE TO BE PASTED MANUALLY] <br /><br /></p>\r\n<p>Our monitoring shows that the user has downloaded a lot of media files (audios and/or videos). Please also note that we tend to ignore the users who are under the 100MB per day. Please discuss this issue with the resouce as soon as possible and intimate us of the outcomes of the meeting. If you wish, MIS/NOC can check the system of {Employee_Name} to verify the cause of this.</p>\r\n<p>Thank you for your cooperation.</p>\r\n<p>&nbsp;</p>\r\n<p>--</p>\r\n<p>Network Operations Control,<br /> Nextbridge Pvt. Ltd. <br /><br /> <strong>Note:</strong> This is an automated email sent from a NOC resource.</p>', '2013-03-03 19:00:00', 0, '2013-08-22 14:42:56', 0),
(4, 'Torrent', '{Employee_Name} / Torrent & Bittorrent activity', '<p>{Manager_Name},</p>\r\n<p>Please see the log below for the user <strong>{Employee_Name}</strong> (EmployeeID {Employee_Id}).</p>\r\n<table style="border: 1px solid #000; width: auto; margin-top: 25px; margin-bottom: 25px;">\r\n<tbody>\r\n<tr>\r\n<td width="200px;">Employee ID</td>\r\n<td width="200px;">{Employee_Id}</td>\r\n</tr>\r\n<tr>\r\n<td>Employee Name</td>\r\n<td>{Employee_Name}</td>\r\n</tr>\r\n<tr>\r\n<td>Manager Name</td>\r\n<td>{Manager_Name}</td>\r\n</tr>\r\n<tr>\r\n<td>Employee Location</td>\r\n<td>{Employee_Location}</td>\r\n</tr>\r\n<tr>\r\n<td>Sitting Hall</td>\r\n<td>{Employee_Sitting_Hall}</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><br /> [LOG TABLE TO BE PASTED MANUALLY] <br /><br /></p>\r\n<p>According to our monitoring tools, there is torrent/bittorrent activity being generated from the system of {Employee_Name}. This can be generated by either a torrent client or a download manager with bittorrent support (e.g. Free Download Manager). At this point, we would also like to highlight the fact that download managers are prohibited as per Employee Handbook.</p>\r\n<p>Please discuss this above mentioned issue with the resouce as soon as possible and intimate us of the outcomes of the meeting. If you wish, MIS/NOC can check the system of&nbsp; to verify the cause of this.</p>\r\n<p>Thank you for your cooperation.</p>\r\n<p>&nbsp;</p>\r\n<p>--</p>\r\n<p>Network Operations Control,<br /> Nextbridge Pvt. Ltd. <br /><br /> <strong>Note:</strong> This is an automated email sent from a NOC resource.</p>', '2013-03-07 10:31:23', 0, '2013-08-22 14:42:56', 0),
(5, 'Gaming (CS)', '{Employee_Name} / Gaming during unapproved timings', '<p>{Manager_Name},</p>\r\n<p>Please see the log below for the user <strong>{Employee_Name}</strong> (EmployeeID {Employee_Id}). <span style="text-decoration: underline;"><strong>We suspect that the user is running Counter Strike since its using udp ports that only Counter Strike/HalfLife uses.</strong></span></p>\r\n<table style="border: 1px solid #000; width: auto; margin-top: 25px; margin-bottom: 25px;">\r\n<tbody>\r\n<tr>\r\n<td width="200px;">Employee ID</td>\r\n<td width="200px;">{Employee_Id}</td>\r\n</tr>\r\n<tr>\r\n<td>Employee Name</td>\r\n<td>{Employee_Name}</td>\r\n</tr>\r\n<tr>\r\n<td>Manager Name</td>\r\n<td>{Manager_Name}</td>\r\n</tr>\r\n<tr>\r\n<td>Employee Location</td>\r\n<td>{Employee_Location}</td>\r\n</tr>\r\n<tr>\r\n<td>Sitting Hall</td>\r\n<td>{Employee_Sitting_Hall}</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><br /> [LOG TABLE TO BE PASTED MANUALLY] <br /><br /></p>\r\n<p>According to our monitoring tools, the <strong>resource was found to be playing games before 7pm</strong>. Please address the disciplinary issue with the resouce as soon as possible and intimate us of the outcomes of the meeting.</p>\r\n<p>Thank you for your cooperation.</p>\r\n<p>&nbsp;</p>\r\n<p>--</p>\r\n<p>Network Operations Control,<br /> Nextbridge Pvt. Ltd. <br /><br /> <strong>Note:</strong> This is an automated email sent from a NOC engineer.</p>', '2013-10-04 13:41:30', 0, '2013-08-22 14:42:56', 0),
(6, 'VPN / Tunnel', '{Employee_Name} / Using VPN or tunnel software', '<p>{Manager_Name},</p>\r\n<p>Please see the log below for the user <strong>{Employee_Name}</strong> (EmployeeID {Employee_Id}).</p>\r\n<table style="border: 1px solid #000; width: auto; margin-top: 25px; margin-bottom: 25px;">\r\n<tbody>\r\n<tr>\r\n<td width="200px;">Employee ID</td>\r\n<td width="200px;">{Employee_Id}</td>\r\n</tr>\r\n<tr>\r\n<td>Employee Name</td>\r\n<td>{Employee_Name}</td>\r\n</tr>\r\n<tr>\r\n<td>Manager Name</td>\r\n<td>{Manager_Name}</td>\r\n</tr>\r\n<tr>\r\n<td>Employee Location</td>\r\n<td>{Employee_Location}</td>\r\n</tr>\r\n<tr>\r\n<td>Sitting Hall</td>\r\n<td>{Employee_Sitting_Hall}</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><br /> [LOG TABLE TO BE PASTED MANUALLY] <br /><br /></p>\r\n<p>According to our monitoring tools, the user is using VPN or tunnel software. Please address the disciplinary issue with the resouce as soon as possible and intimate us of the outcomes of the meeting. If you wish, MIS/NOC can check the system of {Employee_Name} to verify the cause of this.</p>\r\n<p>Thank you for your cooperation.</p>\r\n<p>&nbsp;</p>\r\n<p>--</p>\r\n<p>Network Operations Control,<br /> Nextbridge Pvt. Ltd. <br /><br /> <strong>Note:</strong> This is an automated email sent from a NOC resource.</p>', '2013-04-08 13:23:43', 0, '2013-08-22 14:42:56', 0),
(7, 'AbuseReportr Welcome', 'Welcome!! Your new NOC AbuseReportr account details', '<p>{NAME},</p>\r\n<p>Please find your details to login to NOC <a href="http://projectx.vteamslabs.com">AbuseReportr</a>.</p>\r\n<p><strong>User:</strong> {username}<br />\r\n<strong>Pass:</strong> {password} <br />\r\n<strong>URL:</strong> <a href="http://projectx.vteamslabs.com/">http://projectx.vteamslabs.com/ </a></p>\r\n<p><strong>Note:</strong> Use it responsibly, all actions are being logged once you are in <em>ProjectX</em></p>\r\n<p>--</p>\r\n<p><img src="http://asim.vteamslabs.com/asim.jpg" alt="Asim Zeeshan" width="610" height="170" /></p>', '2013-08-28 10:54:31', 1, '2013-08-28 10:54:31', 1);
